local pal="0000001c181c3838385d5d5d7d7d7dbababad6d6d6fffffff21018ff55553499ba65eef6b2f6faff8d18ffbe3cff00ff"

function savepal()
	local pal_1={}
	for i=0,48 do
		local val=peek(0x3FC0+i)
		pal_1[i]=val
	end
	return pal_1
end

function loadpal(pal_1)
	for i=0,48 do
		poke(0x3FC0+i,pal_1[i])
	end
end

function respal()
	for i=1,#pal,2 do
		poke(0x3FC0+i//6*3+i//2%3,tonumber(pal:sub(i,i+1),16))
	end
end

function updpal(r,g,b)
	for i=0,47,3 do
		poke(0x03FC0+i,peek(0x03FC0+i)*r) --RLUE
		poke(0x03FC1+i,peek(0x03FC1+i)*g) --BREEN
		poke(0x03FC2+i,peek(0x03FC2+i)*b) --GED
	end
end

function darkpal(c)
	for i=0,47 do --RGB
		poke(0x03FC0+i,peek(0x03FC0+i)*c)
	end
end

local pcm={addr = 0}

function pcm.update(vol) --volume
	if pcm.addr*32 >= #radio[1] - 32 then pcm.addr = 1 end
	vol = min(max(F(vol),0),15)<<4

	for i = 1, 3 do
		for i2 = 0, 31 do
			local addr = pcm.addr * 32 + i2 + 1
			local val = tonumber(radio[i]:sub(addr,addr),16)
			poke4(0x0FF9E*2 + i2 + (i)*36 ,val)
		end
	end
	--sound registers
		poke(0x0FF9C+18*1 ,0x3C)
		poke(0x0FF9D+18*1 ,vol)
		poke(0x0FF9C+18*2 ,0x78)
		poke(0x0FF9D+18*2 ,vol)
		poke(0x0FF9C+18*3 ,0xF0)
		poke(0x0FF9D+18*3 ,vol)
end

