		saveinput()
	elseif replay.mode == "play" then
		nextinput()
	end

	--fps counter
	frame_t = time()
	t = t + 1
	--mouse
	mx, my, cl1, _, cl2, _, whl = mouse()
	cid=0 --cursor id

	if cl1 then tm1 = tm1 + 1 else tm1 = 0 end
	if cl2 then tm2 = tm2 + 1 else tm2 = 0 end

	clp1 = tm1 == 1
