				end
				local c2={14711 ,3463 ,5430 ,872 ,420 ,23 ,49 ,8 ,307 ,70 ,0 ,0 ,1172 ,1735 ,2944 ,1436}

				local correct = true
				for i = 1,16 do
					if c[i] ~= c2[i] then correct = false end
				end

				if correct then
					trace("The check was successfully passed!",6)
				else
					trace("The check was failed!",2)
				end
			end
